const LoginPage = ()=>{
  
  
  return(
<form>
    <Title title="JavaScript ty śmieciu "/>
    <Input placeholder="emial"/>
    <Input placeholder="password"/>
    <Button type="submit" buttonText="submit"/>
  
    
    
</form>
)

};
export default LoginPage;
